	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 454px; min-height: 335px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 4px; top: 4px; width: 446px; min-height: 327px;\"><ul style=\"padding: 0px 0px 0px 1px; list-style-position: outside; margin-left: 15px; text-align: left; padding-inline-start: 26px;\">\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Dental Chair: Adjustable for patient comfort and positioning. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Operator\'s Stool: Ergonomically designed for support and mobility. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Assistant\'s Stool: Provides stability and mobility with a foot bar. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Operating Light: Illuminates the oral cavity. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Air-Water Syringe: Rinses and dries the oral cavity. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Oral Evacuation System: Removes debris, saliva, and fluids. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Curing Light: Polymerizes resins and composites. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Amalgamator: Triturates dental materials. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Rheostat: Foot-controlled device for operating handpieces. </span></li>\n	<li style=\"padding-left: 8px; line-height: 1.107; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size:13pt; color: rgb(0, 0, 0);\"><span style=\"font-size:13pt; color: rgb(0, 0, 0); font-family: Arial, sans-serif;\">Dental Unit: Houses handpieces, air-water syringe, and evacuation systems. </span></li>\n</ul></div></div>",
